Information
------------------------------

The Lost Diary of Dr. Livingstone
David Livingstone is the British missionary whose exploration into the 'dark heart' of Central Africa turned him into a legend. His meeting with American journalist Henry Morton Stanley has been immortalised by the iconic phrase, &quot;Dr. Livingstone, I presume&quot;. To celebrate the 200th anniversary of Livingstone's birth in March 1813, The Lost Diary of Dr. Livingstone follows a pioneering American team's ground breaking attempts to decipher his last field diary. Faded and illegible, no one has been able to read these words since Livingstone's death 140 years ago. Now, state-of-the-art multi spectral imaging technology begins an incredible journey inside the mind of this 19th century adventurer.

